(function execute(inputs, outputs) {
    var gcds = new GoogleCloudDatastoreUtils();
    gcds.validateInputVariables(inputs, outputs);
    gcds.validateMandatoryVariables(inputs, ['name']);
    gcds.maptoOutputFromInput(inputs, outputs, []);
})(inputs, outputs);

